	// record per benefit id for each day. For a single day, the maxUtilizationPercentage value will be equal to the largest in
	// the set of values where the set contains 24 utilization percentage entries one for each hour in a specific day. If on the
	// day 2022-10-18, the largest utilization percentage was 90% at hour 5, then the value for the maxUtilizationPercentage in
